import React from 'react'
import firebase from '../utils/firebase'
import '../App2.css'



function Data({ data }) {
    return (
        <div className="stu" id="colorpattern">
            <audio src={"https://firebasestorage.googleapis.com/v0/b/chilldup.appspot.com/o/%E0%B9%84%E0%B8%A7%E0%B8%99%E0%B8%A5%E0%B8%94%E0%B8%B2.mp3?alt=media&token=610d5bc7-509e-44a8-91db-904496d02fed"} />
            {data.name + " อ." + data.class + " เลขที่ " + data.number}
        </div>
    )
}

export default Data;
